In Europa is het oorlog en Jane is verpleegster bij het Britse leger. Ze vraagt in een brief aan Tarzan om bepaalde planten te zoeken tegen malaria. Tarzan en Boy gaan op zoek en komen in een Arabische stad terecht. Daar redden ze een Amerikaanse vrouw met magische krachten van ophanging door de lokale sjeik. Wanneer ze verder gaan zoeken naar e planten komen ze behalve boze Arabieren en nazi's nu ook prehistorische dieren tegen.
